        setMessage(result.message || 'Kh√¥ng nh·∫≠n di·ªán ƒë∆∞·ª£c khu√¥n m·∫∑t');
      }
    } catch (e) {
      setCheckInStatus('error');
      let msg = e.message;
      try {
        // N·∫øu message b·∫Øt ƒë·∫ßu b·∫±ng HTTP 400:, t√°ch l·∫•y ph·∫ßn JSON
        if (msg && msg.includes('HTTP 400:')) {
          const jsonPart = msg.split('HTTP 400:')[1]?.trim();
          if (jsonPart) {
            const parsed = JSON.parse(jsonPart);
            msg = parsed.message || msg;
          }
        }
        // N·∫øu message l√† JSON thu·∫ßn
        else if (msg && msg.startsWith('{')) {
          const parsed = JSON.parse(msg);
          msg = parsed.message || msg;
        }
      } catch {}
      setMessage(msg || 'L·ªói h·ªá th·ªëng');
    }
  }, []);

  return (
    <Card
      style={{
        maxWidth: 700,
        margin: '32px auto',
        background: '#fff',
        borderRadius: 24,
        boxShadow: '0 2px 12px rgba(0,0,0,0.08)',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: 24
      }}
      bodyStyle={{ padding: 0, background: '#fff', borderRadius: 24 }}
      title={<Title level={3} style={{ margin: 0, textAlign: 'center' }}>üü¢ Ch·∫•m c√¥ng b·∫±ng khu√¥n m·∫∑t</Title>}
    >
      <Space direction="vertical" style={{ width: '100%' }} size="large">
        {checkInStatus === 'processing' && <Spin tip="ƒêang x√°c th·ª±c khu√¥n m·∫∑t..." />}
        {checkInStatus === 'error' && message && (
          <Result
            status="error"
