            subTitle={message}
            style={{ background: '#fff', borderRadius: 16, boxShadow: '0 2px 8px rgba(255,0,0,0.04)' }}
          />
        )}
        {checkInStatus !== 'error' && message && (
          <Alert
            message={message}
            type={checkInStatus === 'success' ? 'success' : 'info'}
            showIcon
          />
        )}

        {lastCheckIn && lastCheckIn.nhan_vien && (
          <Result
            icon={<CheckCircleOutlined style={{ color: '#52c41a' }} />}
            title="Ch·∫•m c√¥ng th√†nh c√¥ng!"
            subTitle={
              <Space direction="vertical" size={0}>
                <Text strong>üë§ Nh√¢n vi√™n: {lastCheckIn.nhan_vien.ten}</Text>
                <Text>üÜî M√£ NV: {lastCheckIn.nhan_vien.ma_nhan_vien}</Text>
                <Text>üìÖ Ng√†y: {lastCheckIn.ngay || '-'}</Text>
                <Text>üïí Gi·ªù v√†o: {lastCheckIn.gio_vao || '-'}</Text>
                <Text>üïî Gi·ªù ra: {lastCheckIn.gio_ra || '-'}</Text>
                <Text type="success">üìä Tr·∫°ng th√°i: {lastCheckIn.trang_thai || '-'}</Text>
