        />

        <Card
          size="small"
          style={{ background: '#f4f8fb', borderRadius: 10, textAlign: 'center' }}
          bodyStyle={{ padding: 12 }}
        >
          <Text strong>üïê Th·ªùi gian hi·ªán t·∫°i:</Text>
          <div style={{ fontSize: 20, color: '#007bff', fontWeight: 700 }}>
            {new Date().toLocaleString('vi-VN')}
